import React from "react";

function Task({ index, task }) {
  console.log("Task", index, task.name);
  return (
    <div>
      <div className="task-topbar">
        <h3>{task.name}</h3>
        <p>{task.estimated_duration}</p>
      </div>
      {task.description}
    </div>
  );
}

export default Task;

